<p>Nas asas rápidas, o vento o levará para sua casa sagrada.</p>
<p> </p>
<p>Os enfeites de muitos se escondem aqui, aparentemente seguros do desejo de base.</p>
<p> </p>
<p>Tome asa! Para que esses tesouros mudem de oculto para perdido.</p>
<p> </p>
<p> </p>
